INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('RCKT', 'STOCK', 'Rocket Pharmaceuticals, Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'Rocket Pharmaceuticals, Inc. is a fully integrated, late-stage biotechnology company focused on the development of gene therapies for rare and devastating diseases. The Company has two clinical stage and one pre-clinical stage in vivo adeno-associated viral (AAV) programs in the United States, which include programs for Danon disease (DD), a multi-organ lysosomal-associated disorder leading to early death due to heart failure; Plakophilin-2 Arrhythmogenic Cardiomyopathy (PKP2-ACM), an inheritable cardiac disorder that is characterized by a progressive loss of cardiac muscle mass, severe right ventricular dilation, dysplasia, fibrofatty replacement of the myocardium and a high propensity to arrhythmias and sudden death (RP-A601), and BAG3 Dilated Cardiomyopathy (BAG3-DCM), which is the most common form of cardiomyopathy and is characterized by progressive thinning of the walls of the heart resulting in enlarged heart chambers that are unable to pump blood.', 'Cranbury, NJ, United States', 299);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AEP', 'STOCK', 'American Electric Power Company, Inc.', 'NMS', 'Utilities', 'Utilities - Regulated Electric', 'American Electric Power Company, Inc. É uma empresa de holding de serviços públicos elétricos. Suas empresas operacionais de energia elétrica fornecem serviços de geração, transmissão e distribuição para mais de cinco milhões de clientes de varejo em Arkansas, Indiana, Kentucky, Louisiana, Michigan, EUA. Ohio, Oklahoma, Tennessee, Texas, Virgínia e Virgínia Ocidental. Seus segmentos incluem Utilidades verticalmente integradas, Utilitários de Transmissão e Distribuição, Transmissão AEP Holdco e Geração & Marketing. A Vertical Integrated Utilities está envolvida na geração, transmissão e distribuição de eletricidade para venda a clientes de varejo e atacado. Os Serviços de Transmissão e Distribuição consistem na transmissão e distribuição de eletricidade para venda a clientes de varejo e atacado. A AEP Transmission Holdco está envolvida no desenvolvimento, construção e operação de instalações de transmissão. O segmento de Geração e Marketing realiza atividades de Marketing, Gestão de Ris', 'Columbus, OH, United States', 16330);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CGNX', 'STOCK', 'Cognex Corporation', 'NMS', 'Technology', 'Scientific & Technical Instruments', 'A Cognex Corporation inventa e comercializa tecnologias que abordam vários desafios críticos de fabricação e distribuição. A empresa é uma fornecedora global de produtos e soluções de visão de máquina que melhoram a eficiência e a qualidade em empresas em todos os mercados finais industriais. Opera através do segmento de tecnologia de visão de máquina. Suas soluções combinam produtos físicos e software para capturar e analisar informações visuais, permitindo a automação de tarefas de fabricação e distribuição para clientes em todo o mundo. Os produtos de visão por máquina são usados para automatizar a fabricação ou distribuição e rastreamento de itens discretos, como telefones celulares, baterias de veículos elétricos e pacotes de comércio eletrônico, localizando, identificando, inspecionando e medindo-os. A visão por máquina é importante para aplicações em que a visão humana é inadequada para atender aos requisitos de tamanho, precisão ou velocidade, ou em casos em que economias subst', 'Natick, MA, United States', 2914);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CWH', 'STOCK', 'Camping World Holdings, Inc.', 'NYQ', 'Consumer Cyclical', 'Auto & Truck Dealerships', 'Camping World Holdings, Inc. is a retailer of recreational vehicles (RVs) and related products and services. The Company operates through two segments: Good Sam Services and Plans and RV and Outdoor Retail. Its Good Sam Services and Plans segment consists of programs, plans and services that are geared towards protecting, insuring and promoting the RV & travel lifestyles, and includes services such as extended vehicle service contracts, vehicle roadside assistance, property and casualty insurance, travel protection, travel planning and directories, and publications. Its RV and Outdoor Retail segment consists of all aspects of its RV dealership operations, which includes selling new and used RVs, assisting with the financing of new and used RVs, selling protection and insurance-related services and plans for RVs, servicing and repairing new and used RVs, installing RV parts and accessories, and selling RV and outdoor related products, parts and accessories.', 'Lincolnshire, IL, United States', 12701);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('GL', 'STOCK', 'Globe Life Inc.', 'NYQ', 'Financial Services', 'Insurance - Life', 'A Globe Life Inc. É uma companhia seguradora de seguros. Suas principais subsidiárias são a Globe Life and Accident Insurance Company, a American Insurance Company, a Liberty National Life Insurance Company, a Family Heritage Life Insurance Company of America e a United American Insurance Company. Os segmentos da Companhia incluem seguro de vida, seguro de saúde suplementar e investimentos. Os produtos de seguro de vida incluem seguro de vida inteira e de vida a termo tradicional. A empresa oferece suplemento Medicare e produtos de seguro de saúde suplementar de benefício limitado que incluem acidente, câncer, doença crítica, coração, cuidados intensivos, e outros produtos de saúde. Estes produtos são projetados para complementar a cobertura de saúde que os candidatos já possuem. Os suplementos Medicare são oferecidos a inscritos no tradicional programa Medicare de taxa por serviço. Os planos de Suplemento Medicare são padronizados por regulamentação federal e são projetados para pagar', 'McKinney, TX, United States', 3732);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BTSG', 'STOCK', 'BrightSpring Health Services, Inc.', 'NMS', 'Healthcare', 'Health Information Services', 'BrightSpring Health Services, Inc. provides home and community-based pharmacy and health solutions for populations in need of specialized and/or chronic care. Through the Companys service lines, including pharmacy, home health care and primary care, and rehabilitation and behavioral health, it provides integrated care and clinical solutions in all 50 states to over 450,000 customers, clients and patients daily. With a focus on senior and specialty patients, the Companys platform provides pharmacy and provider services (both clinical and supportive care in nature) in lower-cost home and community settings largely to medicare, medicaid, and commercially insured populations. It delivers services through two reportable segments: Pharmacy Solutions and Provider Services. It provides pharmacy services when and where demanded and as required by customers and patients in their homes and communities, often in coordination with its providers services.', 'Louisville, KY, United States', 37000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BLNE', 'STOCK', 'Beeline Holdings, Inc.', 'NCM', 'Consumer Defensive', 'Beverages - Wineries & Distilleries', 'Beeline Holdings, Inc. is a mortgage fintech transforming the way people access property financing. Through its fully digital, artificial intelligence-powered platform, it delivers a path to home loans-whether for primary residences or investment properties. The Company focuses on prop tech, mortgage, and alternative equity products. The Companys segments include Beeline Financial and Corporate. The Beeline Financial segment is a full-service direct-to-consumer lender specializing in conventional conforming and non-conforming residential first-lien mortgages and providing title services. Beeline Financial also has an emerging business in anonymized data sales and technology licensing.', 'Providence, RI, United States', 91);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ADI', 'STOCK', 'Analog Devices, Inc.', 'NMS', 'Technology', 'Semiconductors', 'Analog Devices, Inc. É uma empresa global de semicondutores. A empresa projeta, fabrica, testa e comercializa um portfólio de soluções, incluindo circuitos integrados (ICs), software e subsistemas que utilizam tecnologias de processamento de sinais analógicos, mistos e digitais de alto desempenho. Seu portfólio abrangente de produtos, especialização de domínio e capacidades de fabricação se estendem por tecnologias de processamento e gerenciamento de energia, precisão de alto desempenho e sinal misto de alta velocidade, incluindo conversores de dados, amplificadores, gerenciamento de energia, ICs de radiofrequência (RF), processadores de borda e outros sensores. O portfólio de produtos IC da empresa inclui tanto produtos de uso geral usados por uma variedade de clientes e aplicações, bem como produtos específicos para aplicativos projetados para mercados-alvo específicos. Seus ICs analógicos monitoram, condicionam, amplificam ou transformam sinais analógicos contínuos associados a prop', 'Wilmington, MA, United States', 24000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('VTYX', 'STOCK', 'Ventyx Biosciences, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Ventyx Biosciences, Inc. is a clinical-stage biopharmaceutical company. The Company is focused on developing oral therapies for patients with autoimmune, inflammatory, and neurodegenerative diseases. Its lead portfolio of NOD-like receptor protein 3 (NLRP3) inhibitors includes VTX2735, a peripherally restricted NLRP3 inhibitor in Phase II development for recurrent pericarditis, and VTX3232, a CNS-penetrant NLRP3 inhibitor in Phase II development for neurodegenerative and cardiometabolic diseases. Its inflammatory bowel disease portfolio includes tamuzimod (VTX002), an S1P1R modulator, and VTX958, a TYK2 inhibitor, both of which have completed Phase II clinical trials. Tamuzimod is a sphingosine 1 phosphate receptor (S1P1R) modulator in development for patients with moderately to severely active ulcerative colitis (UC). VTX958 is a selective allosteric tyrosine kinase type 2 (TYK2) inhibitor in Phase II development for the treatment of moderately to severely active Crohns disease.', 'San Diego, CA, United States', 81);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRI', 'STOCK', 'Carter''s, Inc.', 'NYQ', 'Consumer Cyclical', 'Apparel Retail', 'Carter''s, Inc. É um comerciante de vestuário infantil na América do Norte. Seus segmentos incluem varejo dos EUA, atacado dos EUA e internacional. O segmento de varejo dos EUA inclui vendas de produtos nos Estados Unidos através de suas lojas de varejo e sites de comércio eletrônico. O segmento de atacado dos EUA consiste em vendas nos Estados Unidos de produtos para seus parceiros grossistas. O segmento internacional inclui vendas de produtos fora dos Estados Unidos, através de suas lojas de varejo e sites de comércio eletrônico no Canadá e México, e vendas para seus clientes e licenciados internacionais por atacado. Possui as marcas Carter''s e Oshkosh B''gosh. Essas marcas são vendidas em lojas de departamento, redes nacionais e varejistas especializados no mercado interno e internacional. Eles também são vendidos através de quase 1 000 lojas operadas pela empresa nos Estados Unidos, Canadá e México e on-line em www.carters.com, www.oshkosh.com, www.cartersoshkosh.ca e www.carters.', 'Atlanta, GA, United States', 15350);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AFL', 'STOCK', 'Aflac Incorporated', 'NYQ', 'Financial Services', 'Insurance - Life', 'A Aflac Incorporated fornece proteção financeira aos tomadores de seguros e clientes através de suas subsidiárias nos Estados Unidos e no Japão. O principal negócio da empresa são produtos complementares de seguro de saúde e vida. Os segmentos da empresa incluem a Aflac Japan, que inclui a Aflac Life Insurance Japan (ALIJ), e a Aflac U.S., que inclui a American Family Life Assurance Company of Columbus (Aflac), a American Family Life Assurance Company of New York (Aflac New York), a Continental American Insurance Company (CAIC), a Tier One Insurance Company (TOIC) e a Aflac Benefits Solutions, Inc. (ABS). O segmento Aflac Japan é a seguradora no Japão em termos de políticas de câncer e de saúde (produtos de seguros do terceiro setor) em vigor. A empresa projeta seus produtos de seguro dos Estados Unidos para fornecer cobertura suplementar para pessoas que já têm cobertura médica ou primária de seguro, já que as apólices de seguro Aflac dos EUA pagam benefícios independentemente de outr', 'Columbus, GA, United States', 12694);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EDU', 'STOCK', 'New Oriental Education & Technology Group Inc.', 'NYQ', 'Consumer Defensive', 'Education & Training Services', 'A New Oriental Education & Technology Group Inc é uma holding que atua principalmente no fornecimento de uma variedade de programas educacionais, serviços e produtos. A empresa opera principalmente quatro segmentos. O segmento de Serviços Educativos e Cursos de Preparação de Testes está envolvido principalmente na prestação de serviços educacionais e cursos de preparação de testes e serviços de educação on-line. Os produtos Private Label e o segmento de e-commerce de live streaming estão envolvidos principalmente na venda de produtos de private label e negócios de e-commerce de live streaming através da East Buy. O segmento de Serviços de Consultoria de Estudo no Exterior ajuda principalmente os alunos através do processo de inscrição e admissão para instituições de ensino no exterior, fornece aconselhamento de faculdade, pós-graduação e carreira, e aconselha e auxilia os alunos no processo de imigração para estudos no exterior, como a obtenção de vistos e organização de habitação. Out', 'Beijing, , China', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AZTR', 'STOCK', 'Azitra, Inc.', 'ASE', 'Healthcare', 'Biotechnology', 'Azitra, Inc. is a clinical-stage biopharmaceutical company. The Company is focused on developing advanced therapies for precision dermatology using engineered proteins and topical live biotherapeutic products. It has built a proprietary platform that includes a microbial library comprised of approximately 1,500 unique bacterial strains that can be screened for therapeutic characteristics. The platform is augmented by artificial intelligence and machine learning technology that analyzes, predicts and helps screen its library of strains for drug-like molecules. Its lead product, ATR-12, is a genetically modified strain of S. epidermidis for treating the orphan disease, Netherton syndrome, a chronic and fatal disease of the skin. Its advanced product, ATR-04, is a genetically modified strain of S. epidermidis for treating papulopustular rash. Its product ATR-01 is a human filaggrin protein for treating ichthyosis vulgaris, a chronic, xerotic (abnormally dry), and scaly skin disease.', 'Branford, CT, United States', 12);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARVN', 'STOCK', 'Arvinas, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Arvinas, Inc. is a clinical-stage biotechnology company. The Company, through its PROteolysis Targeting Chimera (PROTAC) protein degrader platform, is pioneering the development of protein degradation therapies designed to harness the bodys natural protein disposal system to selectively and efficiently degrade and remove disease-causing proteins. It is progressing multiple investigational drugs through clinical development programs, including vepdegestrant, ARV-393 and ARV-102. Vepdegestrant is an investigational orally bioavailable PROTAC protein degrader designed to target and degrade the ER for the treatment of patients with locally advanced or metastatic ER+/HER2- breast cancer. It is co-developing vepdegestrant with Pfizer. ARV-393 is an investigational, orally bioavailable PROTAC designed to degrade BCL6, a transcriptional repressor and a key regulator of normal B-cell maturation and differentiation processes. ARV-102 is in development to treat neurodegenerative diseases.', 'New Haven, CT, United States', 430);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CMS', 'STOCK', 'CMS Energy Corporation', 'NYQ', 'Utilities', 'Utilities - Regulated Electric', 'A CMS Energy Corporation é uma empresa de energia que opera principalmente em Michigan. Gere os seus negócios pela natureza dos serviços que cada um presta e opera principalmente em três segmentos de negócio: Electric Utility, Gás Utility e Northstar Clean Energy. O segmento de Utilidade Elétrica consiste em atividades regulamentadas associadas à geração, compra, distribuição e venda de eletricidade em Michigan. O segmento de Gás Utility consiste em atividades regulamentadas associadas à compra, transmissão, armazenamento, distribuição e venda de gás natural em Michigan. O segmento de Energia Limpa Northstar consiste em várias subsidiárias que se envolvem na produção de energia independente nacional, incluindo o desenvolvimento e operação de geração renovável, e a comercialização de produção de energia independente. Seu sistema de transmissão, armazenamento e distribuição de gás consiste em 2 342 quilômetros de linhas de transmissão com 15 campos de armazenamento de gás com uma capacid', 'Jackson, MI, United States', 8324);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COLD', 'STOCK', 'Americold Realty Trust, Inc.', 'NYQ', 'Real Estate', 'REIT - Industrial', 'Americold Realty Trust, Inc. É um fundo de investimento imobiliário (REIT). A Companhia está focada na propriedade, operação, aquisição e desenvolvimento de armazéns com temperatura controlada. A empresa é organizada como um REIT auto-administrado e autogestionado. A Companhia atua por meio de três segmentos: Armazém, Gerido por Terceiros e Transporte. Opera uma rede global de aproximadamente 245 armazéns controlados por temperatura, abrangendo aproximadamente 1,5 bilhões de pés cúbicos, com 197 armazéns na América do Norte, 27 na Europa, 19 armazéns na Ásia-Pacífico e dois armazéns na América do Sul. A Companhia detém participações minoritárias em duas joint ventures, uma com a SuperFrio, que possui ou opera 35 armazéns controlados por temperatura no Brasil, e outra com a RSA JV, que possui dois armazéns controlados por temperatura em Dubai. Seus serviços de manuseio otimizam o movimento de produtos de seus clientes através da cadeia de frio, incluindo colocação e outros serviços de m', 'Atlanta, GA, United States', 13755);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BYND', 'STOCK', 'Beyond Meat, Inc.', 'NMS', 'Consumer Defensive', 'Packaged Foods', 'Beyond Meat, Inc. É uma empresa de carne baseada em plantas que oferece um portfólio de carnes à base de plantas. A empresa desenvolveu três plataformas de produtos centrais à base de plantas que se alinham às maiores categorias de carne do mundo: Carne bovina, suína e aves. Os principais componentes da carne de origem animal são aminoácidos, lipídios, carboidratos, oligominerais e água, que não são exclusivos dos animais e são abundantes em plantas. Seu principal produto é o Beyond Burger, que é projetado para olhar, cozinhar e saborear como um hambúrguer de carne tradicional. A empresa também vende uma gama de outros produtos à base de carne à base de plantas, incluindo além de salsichas, além de carne bovina, além de Meatballs, além de carne crumbles, além de Frango Tenders, além de Steak, além de Frango Popcorn, além de Frango Nuggets, e outros. Seus produtos estão disponíveis em aproximadamente 133 000 lojas de varejo e serviços de alimentos em 65 países, através de supermercados ', 'El Segundo, CA, United States', 754);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AEHR', 'STOCK', 'Aehr Test Systems, Inc.', 'NCM', 'Technology', 'Semiconductor Equipment & Materials', 'Aehr Test Systems, Inc. offers test solutions for testing, burning-in, and stabilizing semiconductor devices in wafer level, singulated die, and package part form. Its products include the FOX-P family of test and burn-in systems and FOX WaferPak Aligner, FOX WaferPak Contactor, FOX DiePak Carrier and FOX DiePak Loader. The FOX-XP and FOX-NP systems are full wafer contact and singulated die/module test and burn-in systems that can test, burn-in and stabilize a range of devices such as silicon carbide-based and other power semiconductors, 2D and 3D sensors used in phones, tablets and other computing devices. FOX-CP system is a single-wafer compact test solution for logic, memory and photonic devices. FOX WaferPak Contactor contains a full wafer contactor capable of testing wafers up to 300 millimeters that enables integrated circuit manufacturers to perform testing, burn-in and stabilization of full wafers on the FOX-P systems. It offers packaged part reliability/burn-in test solutions.', 'Fremont, CA, United States', 136);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DV', 'STOCK', 'DoubleVerify Holdings, Inc.', 'NYQ', 'Technology', 'Software - Application', 'DoubleVerify Holdings, Inc. offers a software platform for digital media measurement and analytics. The Company provides a range of solutions, such as DV Authentic Ad, DV Authentic Attention, Custom Contextual, Scibids AI, and Supply-Side Solutions. The DV Authentic Ad evaluates the existence of fraud, brand safety, viewability and geography for each digital ad. The Authentic Attention analyzes key user-initiated events that occur while the ad creative is exposed, including user touches, screen orientation, video playback, and audio control interactions. The Custom Contextual allows advertisers to match their ads to relevant content in order to maximize user engagement and drive campaign performance. The Supply-side advertising platform utilizes its data analytics to validate the quality of their ad inventory and provide metrics for their customers to facilitate the targeting and purchasing of digital ads.', 'New York, NY, United States', 1197);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('KNSA', 'STOCK', 'Kiniksa Pharmaceuticals International, plc', 'NMS', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'Kiniksa Pharmaceuticals International, plc is a biopharmaceutical company focused on discovering, acquiring, developing and commercializing novel therapies for diseases with unmet need, with a focus on cardiovascular indications. Its portfolio of assets is based on strong biologic rationale or validated mechanisms and offers the potential for differentiation. Its ARCALYST is used for the treatment of recurrent pericarditis and reduces the risk of recurrence in adults and children 12 years and older. ARCALYST is also approved for the treatment of Cryopyrin-Associated Periodic Syndromes (CAPS), including Familial Cold Autoinflammatory Syndrome (FCAS) and Muckle-Wells Syndrome, and the maintenance of remission in Deficiency of Interleukin-1 Receptor Antagonist. Its other portfolio includes KPL-387, KPL-1161, Abiprubart, and Mavrilimumab. Mavrilimumab is an investigational monoclonal antibody inhibitor targeting granulocyte-macrophage colony stimulating factor receptor alpha.', 'London, , United Kingdom', 315);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRGX', 'STOCK', 'CARGO Therapeutics, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'CARGO Therapeutics, Inc. is a biotechnology company focused on the development of best-in-class and potentially curative cell therapies for cancer patients. It has a focused pipeline that includes its CRG-023 product candidate, a CD19/CD20/CD22 tri-specific CAR T developed using a tri-cistronic construct and designed to address several known causes of relapse, resulting in a potential best-in-class CAR T-cell therapy across a range of B-cell malignancies with the goal of providing more patients with a durable complete response. Its latest program advancement, an allogeneic platform, is a universal vector solution designed to limit immune-based rejection and enable durable response of CAR T-cell therapy. The universal allogeneic-enabling vector is intended to be paired with any CAR vector to create an allogeneic CAR T-cell therapy, with the potential to maintain the efficacy, durability, and safety of autologous cell therapy while broadening availability to more people with cancer.', 'San Carlos, CA, United States', 167);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CCEP', 'STOCK', 'Coca-Cola Europacific Partners PLC', 'NMS', 'Consumer Defensive', 'Beverages - Non-Alcoholic', 'Coca-Cola Europacific Partners plc is a United Kingdom-based consumer goods company. The Company is engaged in making, selling and distributing an extensive range of primarily non-alcoholic ready-to-drink (RTD) beverages. The Company''s product categories include Coca-Cola trademark; flavors and mixers; waters, sports, RTD tea and coffee, and other including energy. Its brands include Coca-Cola Original Taste, Coca-Cola Zero Sugar, Diet Coke, Sprite, Fanta, Monster Energy, Costa Coffee and Fuze Tea. The Company''s operations include Europe and Australia, Pacific and Southeast Asia (APS). Its Europe operations include FBN (France, Monaco, Belgium, Luxembourg, the Netherlands, Norway, Sweden and Iceland), Germany, Great Britain, and Iberia (Spain, Portugal and Andorra). The Company''s APS operations include Australia/Pacific (Australia, New Zealand, the Pacific Islands and Papua New Guinea), and Southeast Asia (Indonesia and the Philippines). It operates in approximately 31 markets.', 'Uxbridge, , United Kingdom', 41000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FBRT', 'STOCK', 'Franklin BSP Realty Trust, Inc.', 'NYQ', 'Real Estate', 'REIT - Mortgage', 'Franklin BSP Realty Trust, Inc. is a real estate finance company. The Company primarily originates, acquires, and manages a diversified portfolio of commercial real estate debt investments secured by properties located within and outside the United States. Its investment objective is to provide its common shareholders attractive, risk-adjusted returns through a stable dividend and capital growth. It operates through four segments: the real estate debt business, the real estate securities business, the commercial real estate conduit business and the real estate-owned business. The Company invests in commercial real estate debt investments, which include first mortgage loans, subordinated mortgage loans, mezzanine loans and participations in such loans. It also originates conduit loans that intend to sell through its taxable REIT subsidiary (TRS) into commercial mortgage-backed securities securitization transactions. The investment advisor of the Company is Benefit Street Partners L.L.C.', 'New York, NY, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRBG', 'STOCK', 'Corebridge Financial, Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Corebridge Financial, Inc. is a provider of retirement solutions and insurance products in the United States. The Company partners with financial professionals and institutions to help individuals plan, save for and achieve secure financial futures. Its Individual Retirement segment consists of fixed annuities, fixed index annuities, registered index-linked annuities and variable annuities. Its Group Retirement segment consists of recordkeeping, plan administrative and compliance services, financial planning and advisory solutions offered in-plan, along with proprietary and limited non-proprietary annuities, advisory and brokerage products offered out-of-plan. Its Life Insurance segment consists of term and universal life insurance products in the United States. Its Institutional Markets segment consists of stable value wrap (SVW) products, structured settlement and pension risk transfer (PRT) annuities, guaranteed investment contracts (GICs) and corporate markets products.', 'Houston, TX, United States', 5200);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACHC', 'STOCK', 'Acadia Healthcare Company, Inc.', 'NMS', 'Healthcare', 'Medical Care Facilities', 'Acadia Healthcare Company, Inc. is a provider of behavioral healthcare services across the United States. It provides behavioral healthcare services to its patients in a variety of settings, including inpatient psychiatric hospitals, specialty treatment facilities, residential treatment centers and outpatient clinics. Its acute inpatient psychiatric facilities provide a high level of care in order to stabilize patients that are either a threat to themselves or to others. Its specialty treatment facilities include residential recovery facilities and eating disorder facilities. Its comprehensive treatment centers specialize in providing medication-assisted treatment in an outpatient setting. Its residential treatment centers treat patients with behavioral disorders in a non-hospital setting. The facilities balance therapy activities with social, academic and other activities. It operates a network of 262 behavioral healthcare facilities with over 11,850 beds in 39 states and Puerto Rico.', 'Franklin, TN, United States', 19192);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EVTL', 'STOCK', 'Vertical Aerospace Ltd.', 'NYQ', 'Industrials', 'Aerospace & Defense', 'Vertical Aerospace Ltd. is a United Kingdom-based global aerospace and manufacturing company, which is engaged in the electric aviation. The Company is focused on designing, manufacturing, and selling a zero-operating emission eVTOL aircraft for use in the advanced air mobility (AAM) market. It is developing, and is progressing towards the certification of, its flagship eVTOL, the VX4, which has undergone the first stages of its flight test campaign. It is targeting the VX4 to be capable of transporting a pilot and up to four passengers, traveling distances of up to 100 miles, and achieving cruise speeds of approximately 150 miles per hour. It aims to sell globally certified eVTOL aircraft to a variety of customers, including commercial airlines, aircraft leasing companies, business aviation, existing helicopter operators as well as new operators in the AAM market, providing both original equipment manufacturers (OEM) sales and aftermarket services to its customers.', 'Bristol, , United Kingdom', 350);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CPRI', 'STOCK', 'Capri Holdings Limited', 'NYQ', 'Consumer Cyclical', 'Luxury Goods', 'A Capri Holdings Limited é uma holding, que possui marcas que são designers, comerciantes, distribuidores e varejistas de acessórios femininos e masculinos, calçados e prontos para usar com os nomes de marca Versace, Jimmy Choo e Michael Kors e marcas e logotipos relacionados. A empresa atua em três segmentos: Versace, Jimmy Choo e Michael Kors. O segmento Versace inclui a venda de luxo pronto-a-vestir, acessórios e calçados da Versace através de boutiques da Versace diretamente operadas em todas as Américas, certas partes da Europa, Oriente Médio e África (EMEA) e certas partes da Ásia, bem como através de lojas de outlets e sites de comércio eletrônico da Versace. O segmento Jimmy Choo inclui calçados de luxo Jimmy Choo, bolsas e pequenos artigos de couro e acessórios. O segmento Michael Kors inclui a venda de produtos Michael Kors através de quatro formatos de loja de varejo Michael Kors: Lojas de coleção, lojas de estilo de vida (incluindo concessões), lojas outlet e sites de e-com', 'London, , United Kingdom', 9700);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('APTV', 'STOCK', 'Aptiv PLC', 'NYQ', 'Consumer Cyclical', 'Auto Parts', 'A Aptiv PLC é uma empresa global de tecnologia que desenvolve soluções conetadas que permitem um futuro mais sustentável de mobilidade. A empresa oferece soluções de mobilidade de ponta a ponta, permitindo a transição de seus clientes para veículos mais eletrificados e definidos por software. Os segmentos da Empresa incluem Soluções de Sinal e Energia e Segurança Avançada e Experiência do Usuário. O segmento de Soluções de Sinal e Energia inclui arquitetura elétrica completa e produtos componentes. O segmento de Segurança Avançada e Experiência do Usuário inclui tecnologia e serviços de veículos em segurança avançada, experiência do usuário e computação e software de veículos inteligentes, além de plataformas de software nativas da nuvem, tecnologias de condução autônoma e ferramentas de DevOps. Projeta e fabrica componentes de veículos e fornece soluções de tecnologia de segurança elétrica, eletrônica e ativa para os mercados globais de veículos automotivos e comerciais. Opera instala', 'Schaffhausen, , Switzerland', 141000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLX', 'STOCK', 'The Clorox Company', 'NYQ', 'Consumer Defensive', 'Household & Personal Products', 'A empresa Clorox é uma fabricante multinacional e comerciante de produtos de consumo e profissionais. A empresa atua através de quatro segmentos: Saúde e Bem-Estar, Domicílio, Estilo de Vida e Internacional. O seu segmento de Saúde e Bem-Estar consiste em produtos de limpeza, desinfeção e profissionais comercializados e vendidos sob os setores Clorox, Clorox2, Pine-Sol, Scentiva, Tilex, marcas Liquid-Plumr e Fórmula 409 nos Estados Unidos. Seu segmento doméstico consiste em sacos e envoltórios, lixo para gatos e produtos para grelhar comercializados e vendidos sob as marcas Glad, Fresh Step e Scoop Away, e Kingsford nos Estados Unidos. O segmento de estilo de vida consiste em alimentos, filtração de água e produtos de cuidados pessoais naturais comercializados e vendidos sob as marcas Hidden Valley, Brita e Burt''s Bees. Internacional consiste em produtos vendidos fora dos Estados Unidos. Seus produtos dentro deste segmento incluem aditivos de lavanderia, produtos de cuidados domicilia', 'Oakland, CA, United States', 7600);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FUN', 'STOCK', 'Six Flags Entertainment Corporation', 'NYQ', 'Consumer Cyclical', 'Leisure', 'A Six Flags Entertainment Corporation é uma operadora regional de resort de diversões com aproximadamente 27 parques de diversões, 15 parques aquáticos e nove propriedades de resort em 17 estados Unidos, Canadá e México. A empresa oferece experiências memoráveis a milhões de hóspedes todos os anos com montanhas-russas, passeios temáticos, parques aquáticos emocionantes, resorts e um portfólio de propriedade intelectual, como Looney Tunes, DC Comics e PEANUTS. Os parques da empresa incluem Hurricane Harbor Phoenix, California''s Great America, Knott''s Berry Farm, Knott''s Soak City Waterpark, Six Flags Magic Mountain, Six Flags Discovery Kingdom, Six Flags Over Georgia, Six Flags White Water, Cedar Point Shores Waterpark, Six Flags Great America, Six Flags Fiesta Texas, Hurricane Splashtown, Dorney Park & Wildwater Kingdom e outros.', 'Charlotte, NC, United States', 5000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FIVN', 'STOCK', 'Five9, Inc.', 'NGM', 'Technology', 'Software - Infrastructure', 'A Five9, Inc. Ajuda as organizações a criar experiências de cliente hiper-personalizadas e baseadas em inteligência artificial (IA). A Plataforma CX Inteligente da Empresa, alimentada pela Five9 Genius AI, oferece um conjunto de aplicativos que permitem uma variedade de funções de atendimento ao cliente, vendas e marketing. Ele oferece uma solução de software de nuvem de ponta a ponta para contact centers. A solução da Empresa permite a gestão e otimização simultânea das interações dos clientes através de voz, chat, email, Web, redes sociais e canais móveis, diretamente ou através das suas interfaces de programação de aplicações. As categorias de produtos da empresa incluem Core Cloud, IA & Automation, Employee Engagement e Customer Engagement. Seus produtos Core Cloud incluem Global Voice, Agent Desktop Plus, Supervisor Plus, integrações de CRM e integrações de UC. Seus produtos de IA e automação incluem Inteligência Artificial, agentes de IA, insights de IA, conhecimento de IA, GenAI', 'San Ramon, CA, United States', 3073);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AXP', 'STOCK', 'American Express Company', 'NYQ', 'Financial Services', 'Credit Services', 'A American Express Company é uma empresa de pagamentos globalmente integrada com empresas de emissão de cartões, aquisição de comerciantes e rede de cartões. Oferece produtos e serviços para uma variedade de clientes, incluindo consumidores, pequenas empresas, empresas de médio porte e grandes corporações em todo o mundo. Seus segmentos incluem Serviços ao Consumidor dos EUA (USCS), Serviços Comerciais (CS), Serviços de Cartões Internacionais (ICS) e Serviços Globais de Comercialização e Rede (GMNS). A USCS oferece serviços de viagens e estilo de vida, bem como produtos bancários e de financiamento sem cartão. A CS oferece serviços de gestão de pagamentos e despesas, produtos bancários e de financiamento sem cartão. A ICS presta serviços a clientes internacionais, incluindo serviços de viagens e estilo de vida, e gerencia certas joint ventures internacionais e seu negócio de coalizão de fidelidade. A GMNS opera uma rede de pagamentos que processa e estabelece transações de cartão, adqu', 'New York, NY, United States', 75100);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BGS', 'STOCK', 'B&G Foods, Inc.', 'NYQ', 'Consumer Defensive', 'Packaged Foods', 'B&G Foods, Inc. manufactures, sells and distributes branded shelf-stable and frozen foods across the United States, Canada, and Puerto Rico. Its products include frozen and canned vegetables, vegetable, canola and other cooking oils, vegetable shortening, cooking sprays, oatmeal and other hot cereals, fruit spreads, canned meats and beans, bagel chips, spices, seasonings, hot sauces, wine vinegar, maple syrup, molasses, and other specialty products. It operates in four segments: Specialty, Meals, Frozen & Vegetables, and Spices & Flavor Solutions. Its products are marketed under various brands, including Crisco, Clabber Girl, Bear Creek, Polaner, Underwood, B&G, Grandma''s, New York Style, B&M, Baker''s Joy, Regina, TrueNorth, Static Guard, SugarTwin, Brer Rabbit, Ortega, Maple Grove Farms, Cream of Wheat, Las Palmas, Victoria, Mama Mary''s, Spring Tree, McCann''s, Carey''s, Vermont Maid, Green Giant , Le Sueur, Dash, Spice Islands, Weber, Ac''cent, Tone''s, Trappey''s, Durkee and Wrig', 'Parsippany, NJ, United States', 2610);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DINO', 'STOCK', 'HF Sinclair Corporation', 'NYQ', 'Energy', 'Oil & Gas Refining & Marketing', 'A HF Sinclair Corporation é uma empresa independente de energia que produz e comercializa produtos leves, como gasolina, diesel, combustível a jato, diesel renovável e outros produtos especiais. Seus segmentos incluem Refinação, Renováveis, Marketing, Lubrificantes e Especialidades e Midstream. O segmento de refino inclui as operações de seu El Dorado, Tulsa, Puget Sound, Navajo, Woods Cross, refinarias de Parco e Casper e Asfalto. O segmento de energias renováveis inclui as operações das RDUs Artesia, Cheyenne e Sinclair e da PTU Artesia. O segmento de Marketing inclui vendas de combustível de marca. O segmento Lubrificantes e Especialidades inclui as operações dos negócios Petro-Canada Lubricants, Red Giant Oil e Sonneborn, além de produtos lubrificantes especiais produzidos na refinaria de Tulsa West. O segmento Midstream inclui oleodutos de petróleo e petróleo bruto, instalações de terminais, tanques e prateleiras de carga e unidades de processamento de refinarias que suportam prin', 'Dallas, TX, United States', 5297);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CODX', 'STOCK', 'Co-Diagnostics, Inc.', 'NCM', 'Healthcare', 'Medical Devices', 'Co-Diagnostics, Inc. is a molecular diagnostics company, which develops, manufactures and markets diagnostics technologies. The Companys technologies are utilized for tests that are designed using the detection and/or analysis of nucleic acid molecules (DNA or RNA). The Company also uses its proprietary technology to design specific tests for its Co-Dx PCR platform and to locate genetic markers for use in applications other than infectious disease. Its diagnostics systems enable dependable, low-cost, molecular testing for organisms and genetic diseases by automating or simplifying historically complex procedures in both the development and administration of tests. It is developing a portable diagnostic device and test system designed for point-of-care and at-home use. The system consists of its PCR instrument that it refers to as the Co-Dx PCR Pro instrument, its proprietary diagnostic test cup system and a mobile application to be installed on the users mobile device.', 'Salt Lake City, UT, United States', 132);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('WATT', 'STOCK', 'Energous Corporation', 'NCM', 'Technology', 'Scientific & Technical Instruments', 'Energous Corporation is a developer of over-the-air Wireless Power Network (WPN) technology that integrates advanced semiconductor chipsets, software controls, hardware designs and antenna systems to enable radio frequency (RF)-based charging for Internet of Things devices. Its WPN technology provides a comprehensive suite of capabilities designed to power the wireless energy networks, seamlessly delivering power and data across diverse, battery-free device ecosystems. Its RF-based, scalable WPN solutions enable wireless charging, ranging from contact-based applications to at-a-distance applications, that charge over the air, transforming the way electronic devices are charged and powered. Its wireless power transmitter and receiver technologies deliver continuous access to wireless power, helping drive a new generation of battery-free devices for asset and inventory tracking and management. Its integrated circuits (ICs) are designed for both lower-power and higher-power applications.', 'San Jose, CA, United States', 26);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHD', 'STOCK', 'Church & Dwight Co., Inc.', 'NYQ', 'Consumer Defensive', 'Household & Personal Products', 'A Church & Dwight Co., Inc. Desenvolve, fabrica e comercializa uma gama de produtos domésticos e de cuidados pessoais de consumo e produtos especiais focados na produção animal e alimentar, produtos químicos e produtos de limpeza. Os segmentos da Companhia incluem Consumer Domestic, Consumer International e Specialty Products Division (SPD). O segmento Consumer Domestic inclui cada uma das suas sete marcas de potência, bem como outras marcas e produtos de higiene pessoal e doméstica. O segmento Consumer International comercializa uma variedade de produtos de cuidados pessoais, domésticos e de venda livre em mercados subsidiários internacionais, incluindo Austrália, Canadá, França, Alemanha, Austrália, Austrália, Canadá e outros países. Japão, México, China e Reino Unido. Seu segmento SPD se concentra em vendas para empresas e participa de três áreas de produtos: Nutrição animal, especialidades químicas e comerciais e profissionais. As marcas da Companhia incluem ARM & HAMMER; OXICLEAN;', 'Ewing, NJ, United States', 5750);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CSAN', 'STOCK', 'Cosan S.A.', 'NYQ', 'Energy', 'Oil & Gas Refining & Marketing', 'A Cosan SA, anteriormente conhecida como Cosan SA Indústria e Comércio, é uma empresa sediada no Brasil que atua principalmente no setor de marketing de petróleo. As atividades da Companhia estão divididas em seis segmentos de negócios: Raizen Energia, que produz e distribui derivados de cana-de-açúcar, como açúcar bruto e etanol hidratado, e co-gera energia a partir do bagaço de cana; Raizen Combustiveis, que distribui combustível, principalmente através de uma rede de postos de gasolina sob a marca Shell; Comgas, que se concentra na distribuição de gás natural no estado de São Paulo, Brasil; Radar, responsável pela compra, venda, gerenciamento e arrendamento de terras agrícolas; Lubrificantes, que fabrica e vende lubrificantes sob a marca Mobil no mercado latino-americano, bem como a marca Comma no mercado europeu e asiático, e Outros, que inclui investimentos em outros negócios. A Companhia é uma subsidiária da Cosan Ltd.', 'São Paulo, SP, Brazil', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMX', 'STOCK', 'América Móvil, S.A.B. de C.V.', 'NYQ', 'Communication Services', 'Telecom Services', 'A America Movil, S.A.B. de C.V. é uma holding. A Companhia fornece serviços de telecomunicações. Seus serviços incluem serviços de voz móvel e fixa, serviços de dados sem fio e fixos, acesso à Internet e televisão por assinatura, venda de equipamentos, acessórios e computadores, bem como outros serviços relacionados. Seus segmentos são México Wireless, México Fixo, Brasil, Colômbia, Cone Sul, Região Andina, América Central, Caribe, Estados Unidos e Europa. O segmento do Cone Sul inclui Argentina, Chile, Paraguai e Uruguai. O segmento da Região Andina inclui Equador e Peru. O segmento da América Central inclui Costa Rica, El Salvador, Guatemala, Honduras, Nicarágua e Panamá. O segmento do Caribe inclui a República Dominicana e Porto Rico. O segmento da Europa inclui Áustria, Bielo-Rússia, Bulgária, Croácia, Macedônia, Sérvia e Eslovênia. Atua em todos os seus segmentos geográficos com a marca Claro, exceto no México, Estados Unidos e Europa.', 'Mexico City, DF, Mexico', 177084);\n
